/*Table structure for table `products` */

DROP TABLE IF EXISTS `products`;

CREATE TABLE `products` (
  `product_name` varchar(50) NOT NULL,
  `price` int(11) NOT NULL,
  `image` longblob NOT NULL,
  `Bid_value` int(11) NOT NULL,
  `adharcard` varchar(12) NOT NULL,
  `category` varchar(20) NOT NULL,
  `product_id` int(10) NOT NULL AUTO_INCREMENT,
  `isUpdate` tinyint(1) DEFAULT NULL,
  `customer_adharcard` varchar(15) DEFAULT NULL,
  `endtime` datetime DEFAULT NULL,
  `active` tinyint(1) DEFAULT '0',
  `Quantity` int(10) DEFAULT '0',
  `proceedpay` tinyint(1) DEFAULT '0',
  `farmer_contact` varchar(13) DEFAULT NULL,
  `customer_contact` varchar(13) DEFAULT NULL,
  PRIMARY KEY (`product_id`),
  UNIQUE KEY `product_id` (`product_id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=latin1;

